export default function Collaborate() {
  return (
    <>
      <HeaderContent />
      <main>
        <Section
          title="liên hệ"
          type="hợp tác cùng CFD"
          className="register"
        ></Section>
      </main>
      <FooterContent />
    </>
  );
}
